import React from 'react';

const FeaturedTours = () => {
    return (
        <section className="py-8 text-center">
            <h2 className="text-2xl font-bold mb-6">Featured Tours</h2>
            <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
                {/* Example tour cards */}
                <div className="p-4 bg-gray-100 rounded-lg shadow-md">Tour 1</div>
                <div className="p-4 bg-gray-100 rounded-lg shadow-md">Tour 2</div>
                <div className="p-4 bg-gray-100 rounded-lg shadow-md">Tour 3</div>
            </div>
        </section>
    );
}

export default FeaturedTours;
